import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import UserSidebar from "./UserSidebar";
import axios from "axios";

const baseUrl = 'http://127.0.0.1:8000/api/elearning'


function TakeQuiz() {
  const [courseData, setcourseData]=useState([]);
  const studentId= localStorage.getItem('studentId')
  

  useEffect(() => {
    try {
      axios.get(baseUrl + "/fetch-enrolled-courses/"+studentId).then((res) => {
        setcourseData(res.data);
      });
    } catch (error) {
      console.log(error);
    }
    document.title='My Courses';
  }, []);

  return (
    <div className="container mt-4">
      <div className="row">
        <aside className="col-md-3"><UserSidebar /></aside>
        <section className="col-md-9">
          <h4 className="mb-3 border-bottom pb-1">Quiz Title</h4>
            <div className="card">
            <h5 className="card-header">Question Title </h5>
            <div className='card-body'>
                <table className="table table-bordered">
                    <tbody>
                        <tr>
                          <td>
                            <button></button>
                          </td>
                        </tr>
                    </tbody>
                </table>
            </div>
            </div>
        </section>
      </div>
    </div>
  );
}
export default TakeQuiz;
